CREATE DEFINER=`root`@`localhost` FUNCTION `GenerateRandomNumber`(
	NumDigits int
) RETURNS varchar(20) CHARSET utf8mb4
    DETERMINISTIC
BEGIN
	DECLARE Multiplier BIGINT;
    DECLARE RandNumber BIGINT;
    DECLARE RandString VARCHAR(20);
    DECLARE NumZerosPad INT;
    DECLARE Itr INT;
    
    SET Multiplier = POW(10, NumDigits) - 1;
    SET RandNumber = ROUND((RAND() * Multiplier), 0);
    SET RandString = CAST(RandNumber AS CHAR);
    SET NumZerosPad = NumDigits - LENGTH(RandString);
    
    #If the generated number sequence has fewer digits than specified, then
    #pad with zeros.
    IF (NumZerosPad > 0) THEN
		SET Itr = 1;
        WHILE (Itr <= NumZerosPad) DO
			SET RandString = CONCAT(RandString, '0');
            SET Itr = Itr + 1;
        END WHILE;
    END IF;

RETURN RandString;
END ;;
