CREATE DEFINER=`root`@`localhost` FUNCTION `GenerateSampleDate`(
	_year int,		#Required; dates within specifid 4-digit year will be generated.
	_month int,		#Optional; if specified dates within month will be generated.
	_dayofweek int 	#Optional; if specified dates with specified weekday only will be generated.
) RETURNS date
    DETERMINISTIC
BEGIN
	DECLARE BaseDate date;
	DECLARE GenDate date;
	DECLARE WeekDayInd int;
	DECLARE DateFactor int;
    
	IF (COALESCE(_month, '') = '') THEN
		SET BaseDate = DATE(CONCAT(CAST(_year AS CHAR), '-01-01'));
		SET DateFactor = 364;
	ELSE
		SET BaseDate = DATE(CONCAT(CAST(_year AS CHAR), '-', CAST(_month AS CHAR), '-01'));
		SET DateFactor = 30;
	END IF;
	
	IF (COALESCE(_dayofweek, '') = '') THEN
		SET GenDate = DATE_ADD(BaseDate, INTERVAL ROUND((RAND() * DateFactor), 0) day);
	ELSE
		SET WeekDayInd = 0;
		WHILE (WeekDayInd <> _dayofweek) DO
			SET GenDate = DATE_ADD(BaseDate, INTERVAL ROUND((RAND() * DateFactor), 0) day);
			SET WeekDayInd = DAYOFWEEK(GenDate);
		END WHILE;
	END IF;

	RETURN GenDate;
END ;;
